■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。 その場合はご連絡させて頂きますので予めご了承ください<br><strong><font color="#FF0000" size="+1">ご注文後3～4営業日後の出荷となります（土日除く）</font></strong><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">一重、奥二重の人のためのアイシャドウです。塗り方工夫で目を大きく見せてくれます。</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td width="25%" align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td width="75%" align="left"><font color="#333333" size="-1">6.7&times;6.4&times;H1.3cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">日本</font></td></tr></table><!--ab2--><!--ab--><style type="text/css">
